import './Contact.css'
import React, { useRef, useState } from 'react';
import emailjs from '@emailjs/browser';
import { Container, Row, Col } from "react-bootstrap";
import 'animate.css';
import TrackVisibility from 'react-on-screen';
import  Whatsapp  from '../../assets/img/whatsapp-svgrepo-com.svg'
import Linkedin from '../../assets/img/linkedin-1-svgrepo-com (1).svg'
import Github from '../../assets/img/github-icon-1.svg'
import FaceBook from '../../assets/img/facebook-svgrepo-com.svg'

export const Contact = () => {

  const form = useRef();
  const [errorMessage, setErrorMessage] = useState('');
  const [successMessage, setSuccessMessage] = useState('');

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm('service_qsa9y2q', 'template_kkyewd9', form.current, {
        publicKey: '-ggm7jxKj46V1ZRRg',
      })
      .then(
        () => {
          console.log('SUCCESS!');
          setSuccessMessage('Message sent successfully!');
          setErrorMessage('');
          form.current.reset(); 
        },
        (error) => {
          setErrorMessage(`Failed to send message: ${error.text}`);
          setSuccessMessage('');        },
      );
  };

  return (
    <section className="contact">
      <Container>
        <Row className="align-items-center">
          <Col size={12} md={6}>
            <TrackVisibility>
            <form ref={form} onSubmit={sendEmail}>
              <label>Name</label>
              <input type="text" name="name" />
              <label>Email</label>
              <input type="email" name="email" />
              <label>Phone</label>
              <input type="phone" name="phone" />
              <label>Message</label>
              <textarea name="message" />
              <input type="submit" value="Send" />
              {errorMessage && <p className="error-message">{errorMessage}</p>}
              {successMessage && <p className="success-message">{successMessage}</p>}
            </form>
            </TrackVisibility>
          </Col>
          <Col size={12} md={6}>
            <TrackVisibility>
              {({ isVisible }) =>
                <div>
                <h2>Get In Touch</h2>
                    <div className="contact">
                      <div className="AA">
                        <img src = {Whatsapp} alt="Whatsapp" />
                      <a className="Chat" href="https://wa.me/01018324127">Chat my on WhatsApp</a>
                      </div>
                      <div className="AA">
                        <img src = {Github} alt="Whatsapp" />
                      <a imclassName="Chat" href="https://github.com/AmrAhmed68">Discover my github</a>                      
                      </div>
                      <div className="AA">
                        <img src = {Linkedin} alt="Whatsapp" />
                      <a className="Chat" href="https://www.linkedin.com/in/amr-ahmed682003/">Discover my Linkedin</a>                      
                      </div>
                      <div className="AA">
                        <img src = {FaceBook} alt="FaceBook" />
                      <a className="Chat" href="https://www.facebook.com/profile.php?id=100009582705852&mibextid=JRoKGi">Discover my Facebook</a>                      
                      </div>
                    </div>
              </div>}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>
    </section>
  )
}
